/* eslint-disable jsx-a11y/anchor-is-valid */
/* eslint-disable import/no-anonymous-default-export */
import "./Header.css";
import img06 from "../../../src/Foto/img/OIP.jpg";
import Card02 from "./Carroussel/Card02/Card02";
import { Link } from "react-router-dom";

export default () => {
  return (
    <header id="inicio">
      <div className="topo">
        <h1>Agencia de Turismo Autoestima</h1>
      </div>

      <nav
        className="nav nav-pills flex-column flex-sm-row"
        Style="background-color: rgb(242, 255, 0)"
      >
      <Link to="/"
      
          className="flex-sm-fill text-sm-center nav-link"
          aria-current="page">
          Home 
      </Link>
      <Link to="/Destino"
      
          className="flex-sm-fill text-sm-center nav-link">
          Destino 
      </Link>
      <Link to="/Compra"
      
          className="flex-sm-fill text-sm-center nav-link">
          Compra 
      </Link>
      <Link to="/Sac"
      
        className="flex-sm-fill text-sm-center nav-link">
          Sac 
      </Link>
      </nav>
      <div className="card" alt=" 750x1330 height: 750px;width: 1330px">
        <Card02 Foto={img06} alt="..."></Card02>
      </div>
    </header>
  );
};
